import React from 'react';
import { Box, Grid, makeStyles } from '@material-ui/core';
import { SectionHeading } from '../Component';
import { PricingCard } from './PricingComponent/PricingComponent';
import { PricingData } from './PricingData';
import './Css/Pricing.scss'

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" }
}))

const Pricing = () => {
    const classes = useStyles();
    return (
        <>
            <Box my={5} className="pricingWrapper">
                <Grid container>
                    <Grid item lg={10} md={11} className={classes.margin}>
                        <Box>
                            <SectionHeading head="Our Pricing" />
                            <Box py={4}>
                                <Grid container spacing={5}>
                                    {PricingData.map((item, index) => {
                                        return (<PricingCard className="grow" key={index} title={item.plan} price={item.price} facilities={item.services} />)
                                    })}
                                </Grid>
                            </Box>
                        </Box>
                    </Grid>
                </Grid>
            </Box>
        </>
    )
}

export default Pricing;
